import React from 'react';
import '../styles/notice.css';

function NoticeMain() {
  return (
    <div>
    <div className='notice'>
      <h5>공지 알립니다!</h5>
      <p className='noticeDate'>2023.01.16</p>
      <p>어쩌구 저쩌구</p>
    </div>
    </div>
  );
}

export default NoticeMain;
